            <div class="description_log">
                <h4>Description :</h4>
                <p class="txt_descr_log">Cet agréable logement situé à deux pas de la magnifique côte de granit rose propose un
                    agréable séjour très lumineux, deux chambres accueillantes ainsi qu’une cuisine pour vous laver et une salle
                    de bain pour cuisiner. En tant qu’aquaman, je dispose de toute l’eau du monde, donc l’eau est gratuite.
                    Venez. Chez moi.</p>

